import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const sayHello = () => console.log('hello');
sayHello();

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
